inity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"12267","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"11969"},"glyph":{"id":"12232"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"12234"},"nonselection_glyph":{"id":"12233"},"view":{"id":"12236"}},"id":"12235","type":"GlyphRenderer"},{"attributes":{},"id":"12176","type":"DataRange1d"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"12215"},"group":null,"major_label_policy":{"id":"12329"},"minor_tick_line_color":null,"ticker":{"id":"12187"}},"id":"12186","type":"LinearAxis"},{"attributes":{},"id":"12268","type":"CrosshairTool"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"11972"}},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"12163","type":"Scatter"},{"attributes":{"line_alpha":{"value":0.2},"x0":{"field
